import Vuex from 'vuex'
import Vue from 'vue'
Vue.use(Vuex)
export default new Vuex.Store({
  state: {
    data:"eee"
  },
  getters: {
  },
  mutations: {
    sendTodo(state,params) {
      state.data = params
    }
  },
  actions: {
    increment({ commit } , data) {

      commit('sendTodo',data)

    }
  },
  modules: {
  }
})
